	angular.module('BlankApp',  ['ngMaterial', 'ngMdIcons'])
	.controller('PositionDemoCtrl', function DemoCtrl($mdDialog) {
	 var vm = this;
	    vm.announceClick = function(index) {
		  $mdDialog.show(
	        $mdDialog.alert()
	          .title('You clicked!')
	          .textContent('You clicked the menu item at index ' + index)
	          .ok('Nice')
	          .targetEvent(originatorEv)
	      );
	      originatorEv = null;
	    };
	  vm.toggleLeft = function() {
	    $mdSidenav('left-nav').toggle();
	  };
	  vm.close = function() {
	    $mdSidenav('left-nav').close();
	  }
  });

var header = document.querySelector(".header");
var input = document.querySelector(".search-box-input");
var close = document.querySelector(".delete");

function hideHeader() {
  header.classList.remove('show');
  header.classList.add('hide');
};

function showHeader() {
  if (input.value === '') {
    header.classList.remove('hide');
    header.classList.add('show');
  }
};

function showHeaderOnClose() {
  header.classList.remove('hide');
  header.classList.add('show');
};

input.addEventListener("focus", hideHeader);
input.addEventListener("blur", showHeader);
close.addEventListener("click", showHeaderOnClose);


$(document).ready(function(){
    $('#table_id').DataTable();
});
